import { Routes,Route , Navigate } from "react-router-dom";
import BlogList from "./blogList";
import Home from "./home";
import { Navbar } from "./Navbar";

const App = () => {
    return (
        <div className="hello">
            <header className="header">
                <Navbar/>
            </header>
            <main>
                <Routes>
                    <Route path="/" element = {<Home/>}></Route>
                </Routes>
            </main>
           
 
        
        </div>
    );
};

export default App;
